import axios from 'axios'
import { postWithoutTokenFunciton,getFunciton } from 'utils/ApiHelper'
import { AccountModel } from '../models/Account'



export async function getListAccount() {
  const res:any = await getFunciton("vps/list")
  return res
}


export async function updateAccount(account:AccountModel) {
  const res:any = await postWithoutTokenFunciton("account/update",account)
  return res
}
